import React from "react";
import styled, { ThemeProvider } from "styled-components";

const Ban = styled.div`
  width: 100%;
  height: 100%
  position: relative;
  & img {
    top: 0;
    left: 0;
    position: absolute;
    width: 100%;
    border-radius: 50%;
  }
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <Ban>
          <img src={require("./img/yone.jpg")} width={"90%"} height={"90%"} />
          <img src={require("../../../config/assets/ban-border-blue.png")} />
        </Ban>
      </ThemeProvider>
    );
  }
}
